,INTL_LABEL_PROVIDE_THE_MICROSOFT_SQL_SERVER_DATABASE_NAME:"Ange databasnamn f\u00f6r Microsoft SQL Server.",INTL_LABEL_PROVIDE_THE_HOST_NAME_OF_THE_COMPUTER_RUNNING_MICROSOFT_SQL:"Ange v\u00e4rdnamnet f\u00f6r datorn som Microsoft SQL Server k\u00f6rs fr\u00e5n. Det h\u00e4r v\u00e4rdet m\u00e5ste anges.",INTL_LABEL_PROVIDE_THE_PORT_NUMBER_OF_THE_MICROSOFT_SQL_SERVER_THIS:"Ange portnumret f\u00f6r Microsoft SQL Server: Detta v\u00e4rde m\u00e5ste anges.",INTL_LABEL_PROVIDE_THE_NAME_OF_THE_IBM_DB_UDB_SCHEMA_QUALIFIER:"Ange namnet p\u00e5 schemakvalificeraren f\u00f6r IBM DB2 UDB eller tabell\u00e4garens namn och databasalias f\u00f6r IBM DB2.",INTL_LABEL_PROVIDE_THE_NAME_OF_THE_IBM_DB_UDB_SQL_ID:"Ange namnet p\u00e5 id f\u00f6r IBM DB2 UDB SQL eller gruppnamnet.",INTL_LABEL_PROVIDE_A_LOCATION_FOR_THE_PRIMARY_SIEBEL_FILE_SYSTEM_THE:"Ange en plats f\u00f6r prim\u00e4rt Siebel-filsystem. Platsen m\u00e5ste anges i UNC-format. I plattformsoberoende milj\u00f6er m\u00e5ste du anv\u00e4nda kompatibla verktyg f\u00f6r delningsmontering f\u00f6r alla filsystem. F\u00f6r att ange flera partitioner f\u00f6r stora filsystem, g\u00e5 till f\u00f6retagsmilj\u00f6ns \u00e4ndringsuppgifter f\u00f6r konfigurering och v\u00e4lj inst\u00e4llning av bilagepartition f\u00f6r f\u00f6retagsmilj\u00f6ns filsystem.",INTL_LABEL_SPECIFY_A_NAME_FOR_THE_SIEBEL_ENTERPRISE_THE_NAME_MAY:"Ange ett namn f\u00f6r Siebel Enterprise. Namnet kan inneh\u00e5lla bokst\u00e4ver, siffror och understreck och kan maximalt best\u00e5 av 12 tecken. Specialtecken st\u00f6ds inte. F\u00f6retagsmilj\u00f6namnet m\u00e5ste vara unikt n\u00e4r den h\u00e4r f\u00f6retagsmilj\u00f6n skapas.",INTL_LABEL_THE_DESCRIPTION_OF_THE_ENTERPRISE_IS_USED_FOR_YOUR_REFERENCE:"Beskrivningen av f\u00f6retagsmilj\u00f6n anv\u00e4nds som din referens. Du kan till exempel ange en beskrivning som hj\u00e4lper till att identifiera en test- eller produktionsmilj\u00f6.",INTL_LABEL_ENTER_THE_COMPONENT_GROUPS_TO_ENABLE_IN_THIS_SIEBEL_SERVER:"Ange de komponentgrupper som ska aktiveras i denna Siebelserver. F\u00f6r mer information om komponentgrupper, se Siebel System Administration Guide.",INTL_LABEL_ENTER_THE_TCPIP_PORT_NUMBER_ON_WHICH_THE_SIEBEL_CONNECTION:"Ange numret p\u00e5 den TCP/IP-port d\u00e4r komponenten Siebels anslutningsf\u00f6rmedlare kommer att ta emot inkommande trafik f\u00f6r Siebelservern. Anv\u00e4ndning av standardporten (2321) rekommenderas starkt om inte denna port anv\u00e4nds av n\u00e5gra andra Siebelkomponenter eller applikationer samlokerade p\u00e5 detta system. M\u00f6jliga v\u00e4rden ligger mellan 0 och 65535.",INTL_LABEL_SPECIFY_A_PORT_NUMBER_FOR_THE_SIEBEL_REMOTE_SYNCHRONIZATION_MANAGER:"Ange ett portnummer f\u00f6r fj\u00e4rrsynkroniseringshanteraren p\u00e5 denna server eller serverprofil att avlyssna. Denna port kommer att anv\u00e4ndas ist\u00e4llet f\u00f6r den standardport som angetts f\u00f6r f\u00f6retagsmilj\u00f6n. Kontrollera att denna port inte anv\u00e4nds av n\u00e5gra andra applikationer. Normalt beh\u00f6ver denna port bara \u00e4ndras om en port anv\u00e4nds av en annan Siebelserver p\u00e5 samma fysiska dator. (standard 40400, intervall 0-65535)",INTL_LABEL_SERVERSPECIFIC_SECURITY_ENCRYPTION_SETTINGS:"Inst\u00e4llningar av serverspecifik s\u00e4kerhetskryptering.",INTL_LABEL_SERVERSPECIFIC_SECURITY_AUTHENTICATION_PROFILE_ASSIGNMENT:"Profiltilldelning av serverspecifik s\u00e4kerhetsautentisering.",INTL_LABEL_IN_CERTAIN_INSTANCES_IT_IS_USEFUL_TO_CLUSTER_SIEBEL_SERVERS:"I vissa fall \u00e4r det l\u00e4mpligt att klustra Siebelservrar f\u00f6r att ge h\u00f6g tillg\u00e4nglighet. Klusternoderna m\u00e5ste startas efter klusterinstruktioner om detta alternativ v\u00e4ljs. Information om alternativ f\u00f6r h\u00f6g tillg\u00e4nglighet finns i Siebel Bookshelf.",INTL_LABEL_SIEBEL_SERVER_CLUSTER_VIRTUAL_HOST_NAME_IP_VALID_NETBIOS_NAME_OR:"Siebelserverkluster virtuellt v\u00e4rdnamn/IP (giltigt NETBIOS-namn eller IP-adress, t.ex.192.168.0.1).",INTL_LABEL_